import React from 'react';
import Raid from './Raid.js';


const RaidList = ({raids}) => {
	const raidNodes = raids.map((raid) => {
		return (<li key={raids.id} className="component-item">
			<Raid raid={raids} />
		</li>
		)
	})

	return (
		<ul className="component-list">
			{raidNodes}
		</ul>

	)
}
export default RaidList;
